import React from "react";
import AppRouter from "./component/Router";
import {Link} from 'react-router-dom';

const App = () => {

  return (
    <>

    <header>
      <div className="header-wrapper">
        <div className="header-logo">GENE LAB</div>
        <AppRouter/>
      </div>
    </header>
    <div id="content-wrapper">
      <div id="content">
        CONTENTS
      </div>
    </div>
    <footer>
      FOOTER
    </footer>
    </>
  )
}

export default App;
